import re
import numpy as np
import random
import sys
MMic=""
PPru=""
SSie=""

def last(str):
    return len(str) - 1


string = MMic
out = ""
buff = ""
nums = 0
for i in range(0, len(string)):
    nums += ord(string[i])
    if buff == "" :
        buff += string[i]
        continue

    if ord(buff[last(buff)]) + 1 == ord(string[i]):
        buff += string[i]
    else:
        out += buff[0] 
        num = ord(buff[last(buff)]) - ord(buff[0])

        if (num > 0): 
            out += str(num)
        buff = string[i]

print(len(out))
print(len(string))
print(len(str(nums)))
print(string)
print(out)
print(nums)


sys.exit(0)
Mic=[MMic[i:i+4] for i in range(0, len(MMic), 4)]
Pru=[PPru[i:i+4] for i in range(0, len(PPru), 4)]
Sie=[SSie[i:i+4] for i in range(0, len(SSie), 4)]

def count(string, minLen,splitl):
    pattern = '[^A-Za-z0-9]+'
    validWords=[x.lower()[:splitl] for x in re.split(pattern, string) if len(x) >=minLen]

    mic = 0
    pru = 0
    sie = 0
    for word in validWords:
        if (word in Mic):
            mic += 1 
        if (word in Pru):
            pru += 1 
        if (word in Sie):
            sie += 1 

    if mic == pru == sie:
        return random.randint(0,2)
    return np.argmax((mic, pru, sie))

makers = ["Mickiewicz","Prus","Sienkiewicz"]
T = int(input())
for i in range(T):
    frag = input()
    print(makers[count(frag,4,4)])

